import React, { Component } from 'react';

class Featured extends Component {

	mouseEnter = () => {
		console.log('enter')
		//return current project
		//this.props.hoverDisplay("river")
		this.setState({
	      onHighLight: true
	    })		
	}
	mouseExit = () => {
		console.log('exit')
		//clear current
		this.setState({
	      onHighLight: false
	    })		
	}

	render() {
		return(
			<div className= "featured">
				<div className = "highlight" onClick={this.props.toggleDisplay} onMouseEnter={this.mouseEnter} onMouseLeave={this.mouseExit}>	
					<h4 className="tittle river">
						river
					</h4>
				</div>
				<div className = "highlight" onClick={this.props.toggleDisplay} onMouseEnter={this.mouseEnter} onMouseLeave={this.mouseExit}>	
					<h4 className="tittle dd">
						double dog
					</h4>				
				</div>
				<div className = "highlight" onClick={this.props.toggleDisplay} onMouseEnter={this.mouseEnter} onMouseLeave={this.mouseExit}>	
					<h4 className="tittle mm">
						matchmaking
					</h4>				
				</div>
				<div className = "highlight spotlight">
					<h5>
						hover over the featured projects to learn more about them. click on the project to get more indeph information.
					</h5>
				</div>											 
			</div>
		)
	}
}

export default Featured
